import React from "react";
import { UsersList } from "../components/UsersList";

export function Users() {
  const USERS = [
    {
      id: "u1",
      name: "Arthur Fleck",
      image:
        "data:image/jpeg;base64,",
      places: 3,
    },
  ];

  return (
    <>
      <UsersList items={USERS} />
    </>
  );
}
